import React from 'react';
import UserService from '../services/UserService';

class UserCount extends React.Component {

    constructor(props){
        super(props)
        this.state = {
            users: []
        }
    }

    componentDidMount(){
        UserService.getUsers().then((response) => {
            this.setState({users: response.data})
        });
    }
    
    render(){
        return(
            <div>
                <h2>Users Created: </h2>
            </div>
        );
    }
}

export default UserCount;
